use happyhouse;

drop table housedeal;
CREATE TABLE housedeal(
   no         bigint  NOT NULL PRIMARY KEY auto_increment
  ,buildYear  varchar(30)  NOT NULL
  ,dealYear   int  NOT NULL
  ,dong       VARCHAR(30) NOT NULL
  ,dealAmount bigint NOT NULL -- 매매면 거래금액, 전월세면 보증금 
  ,AptName    VARCHAR(50) NOT NULL
  ,dealMonth  int NOT NULL
  ,rentMoney  bigint  NOT NULL
  ,dealDay    int  NOT NULL
  ,area       NUMERIC(7,4) NOT NULL
  ,jibun      VARCHAR(30) NOT NULL
  ,code       INTEGER  NOT NULL
  ,floor      INTEGER  NOT NULL
  ,aptType    boolean not null -- true 면 아파트
  ,dealType   boolean not null -- true 면 매매
);



select dealMonth from housedeal group by dealMonth;
select distinct code from housedeal;